class Solution:
    def hasGroupsSizeX(self, deck):
        """
        :type deck: List[int]
        :rtype: bool
        """

        dnc = {}

        for num in deck:
            if num not in dnc:
                dnc[num] = 1
            else:
                dnc[num] += 1

        lc = list(dnc.values())
        min_count = min(lc)

        if min_count < 2:
            return False

        gyss = [min_count]
        import math
        for gys in range(2, math.floor(math.sqrt(min_count)) + 1):
            if min_count % gys == 0:
                gyss.append(gys)
                gyss.append(min_count // gys)

        for gys in gyss:
            for count in lc:
                if count % gys != 0:
                    break
            else:
                return True

        return False

